import React from "react";
import "./App.css";
import "antd/dist/antd.css";
import { Form, Radio, Button } from "antd";
import { Input } from "antd";

interface Props {
  name: string;
  code: string;
  title: string;
  description: string;
  flat: boolean;
  threshold: boolean;
  flexible: boolean;
  position: number;
  reportOverride: boolean;
  workflowStatus: number;
  onSubmit: Function;
  handleFormChange: Function;
}

export const FormApp: React.FC<Props> = ({
  name,
  code,
  title,
  description,
  flat,
  threshold,
  flexible,
  handleFormChange,
  onSubmit
}) => {
  return (
    <Form>
      <label>Name: </label>
      <Input
        name="name"
        value={name}
        onChange={(event: any) => {
          handleFormChange("name", event.target.value);
        }}
      ></Input>
      <br></br>
      <label>Code:</label>
      <Input
        name="code"
        value={code}
        onChange={(event: any) => {
          handleFormChange("code", event.target.value);
        }}
      ></Input>
      <br></br>
      <label>Title: </label>
      <Input
        name="title"
        value={title}
        onChange={(event: any) => {
          handleFormChange("title", event.target.value);
        }}
      ></Input>
      <br></br>
      <label>description: </label>
      <Input
        name="description"
        value={description}
        onChange={(event: any) => {
          handleFormChange("description", event.target.value);
        }}
      ></Input>
      <br></br>
      <label>flat: </label>
      <Radio
        value={flat}
        name="flat"
        defaultChecked={false}
        onChange={(event: any) => {
          handleFormChange("flat", event.target.checked);
        }}
      ></Radio>
      <br></br>
      <label>threshold </label>
      <Radio
        name="threshold"
        defaultChecked={false}
        value={threshold}
        onChange={(event: any) => {
          handleFormChange("threshold", event.target.checked);
        }}
      ></Radio>
      <br></br>
      <label>flexible </label>
      <Radio
        name="flexible"
        value={flexible}
        defaultChecked={false}
        onChange={(event: any) => {
          handleFormChange("flexible", event.target.checked);
        }}
      ></Radio>
      <br></br>
      <br></br>
      <Button
        type="primary"
        onClick={(e: any) => {
          onSubmit();
        }}
      >
        Aggiungi
      </Button>
    </Form>
  );
};
